$(document).ready(function(){


    $('#data-table-simple').DataTable();
   
    
    var table = $('#data-table-row-grouping').DataTable({
		dom: '<"top"lBf<"clear">>rt<"bottom"ip<"clear">>',
		buttons: [
			{ extend: 'copyHtml5',
			text: 'Copiar',
			},
			{ extend:'excelHtml5',
			text: 'Excel',
			},
			'csvHtml5',
			/*'pdfHtml5',*/
			 {
            extend: 'pdfHtml5',
			orientation: 'landscape',
            customize: function ( doc ) {
                // Splice the image in after the header, but before the table
                doc.content.splice( 1, 0, {
                    margin: [ 0, 0, 0, 12 ],
                    alignment: 'center',
                    image: 'data:image/png;base64,'
                } );
                // Data URL generated by http://dataurl.net/#dataurlmaker
            }
        } 
		],

		"columnDefs": [
            { "visible": false, "targets": 0 } //OCULTA LA COLUMNA POR LA QUE SE AGRUPAN LOS DATOS
        ],
        "order": [[ 0, 'asc' ]],  //DEFINE CUAL ES LA COLUMNA POR LA QUE SE ORDENAN LOS DATOS
        "displayLength": 100,
        "drawCallback": function ( settings ) {
            var api = this.api();
            var rows = api.rows( {page:'current'} ).nodes();
            var last=null;
 
            api.column(0, {page:'current'} ).data().each( function ( group, i ) { //DEFINE CUAL ES LA COLUMNA POR LA QUE SE AGRUPAN LOS DATOS
                if ( last !== group ) {
                    $(rows).eq( i ).before(
                        '<tr class="group"><td colspan="14">'+group+'</td></tr>' //12 DEFINE COLSPAN de la columna agrupada
                    );
 
                    last = group;
                }
            } );
        }
    });
 
    // Order by the grouping
    $('#data-table-row-grouping tbody').on( 'click', 'tr.group', function () {
        var currentOrder = table.order()[0];
        if ( currentOrder[0] === 0 && currentOrder[1] === 'asc' ) {
            table.order( [ 0, 'desc' ] ).draw();
        }
        else {
            table.order( [ 0, 'asc' ] ).draw();
        }
    } );

	//Tabla Simple 
	var table = $('#data-table-row-grouping-1').DataTable({
		dom: '<"top"lBf<"clear">>rt<"bottom"ip<"clear">>',
		buttons: [
			{ extend: 'copyHtml5',
			text: 'Copiar',
			},
			{ extend:'excelHtml5',
			text: 'Excel',
			},

		],

		"columnDefs": [
            { "visible": true, "targets": 0 } //OCULTA LA COLUMNA POR LA QUE SE AGRUPAN LOS DATOS
        ],
//        "order": [[ 0, 'asc' ]],  //DEFINE CUAL ES LA COLUMNA POR LA QUE SE ORDENAN LOS DATOS
        "displayLength": 100,
  		"paging": false,
		"searching": false,
    });
 
    // Order by the grouping
    $('#data-table-row-grouping-1 tbody').on( 'click', 'tr.group', function () {
        var currentOrder = table.order()[0];
        if ( currentOrder[0] === 0 && currentOrder[1] === 'asc' ) {
            table.order( [ 0, 'desc' ] ).draw();
        }
        else {
            table.order( [ 0, 'asc' ] ).draw();
        }
    } );


 
    // DataTable

 

	
//	    $('#exampleTable').DataTable( {
//		"displayLength": 25,
//		"autoWidth": true,
//        "order": [[ 0, "desc" ]]
//			
//    } );
	
	$('#TablaBasica tfoot th').each( function () {
        var title = $(this).text();
        $(this).html( '<input type="text" placeholder="Buscar '+title+'" />' );
    } );
	
	 var table = $('#TablaBasica').DataTable({
		"displayLength": 25,
		"autoWidth": true,
        "order": [[ 2, "asc" ]]
			
    });
	    // Apply the search
    table.columns().every( function () {
        var that = this;
 
        $( 'input', this.footer() ).on( 'keyup change', function () {
            if ( that.search() !== this.value ) {
                that
                    .search( this.value )
                    .draw();
            }
        } );
    } );
    });